export default function Header({title}) {
  return (
    <header className="bg-gray-800 text-white p-4 flex items-center shadow-lg">
      {/* Logo Image */}
      <img src="https://via.placeholder.com/50" alt="Logo" className="h-12 w-12 rounded-full mr-4" />

